--------------------------------------------------------
--  DDL for View V_GRADESBYRANK
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CISC181"."V_GRADESBYRANK" ("STUDENT_ID", "SECTION_ID", "GRADE_TYPE_CODE", "NUMERIC_GRADE", "DROP_LOWEST", "SCORERANK") AS 
  (

select G.Student_ID, 
       G.Section_ID, 
       G.grade_Type_Code, 
       G.numeric_grade,
       GTW.DROP_LOWEST,
       RANK() OVER (PARTITION BY G.Student_ID, G.Student_ID, G.grade_Type_Code ORDER BY numeric_grade DESC) ScoreRank
from grade g
inner join grade_type_weight gtw
on g.section_id = gtw.section_id
and g.grade_type_code = gtw.grade_type_code);
--------------------------------------------------------
--  DDL for View V_GRADESUMMARY
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CISC181"."V_GRADESUMMARY" ("SECTION_ID", "STUDENT_ID", "SUMGRADE") AS 
  (Select Section_ID,
        Student_ID,
        sum(avggrade) as SumGrade
from 

(Select g.Student_ID,
       g.Section_ID,
       g.Grade_Type_code,
       (avg(g.numeric_Grade) * gtw.percent_of_final_grade * 0.01) as avgGrade,
       gtw.number_per_section,
       gtw.percent_of_final_grade,
       gtw.drop_lowest
from V_GRADEWITHDROPS g
inner join Grade_Type_Weight gtw
on g.section_id = gtw.section_Id
and g.grade_type_code = gtw.Grade_Type_Code
group by g.Student_ID,
       g.Section_ID,
       g.Grade_Type_code,
       gtw.number_per_section,
       gtw.percent_of_final_grade,
       gtw.drop_lowest) 
group by Student_ID, Section_id);
--------------------------------------------------------
--  DDL for View V_GRADEWITHDROPS
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CISC181"."V_GRADEWITHDROPS" ("STUDENT_ID", "SECTION_ID", "GRADE_TYPE_CODE", "NUMERIC_GRADE", "SCORERANK") AS 
  (

select gbr.student_id,
       gbr.section_id,
       gbr.Grade_Type_code,
       gbr.numeric_grade,
       gbr.scorerank
from v_gradesbyrank gbr
Where scorerank < 
  (Select Max(ScoreRank) 
   from v_gradesbyrank gbr2
   where gbr2.student_id = gbr.student_id
     and gbr2.section_id = gbr.Section_id
     and gbr2.grade_type_code = gbr.grade_type_code)
and gbr.Drop_lowest = 'Y'
union all
select gbr.student_id,
       gbr.section_id,
       gbr.Grade_Type_code,
       gbr.numeric_grade,
       gbr.scorerank
from v_gradesbyrank gbr
Where gbr.Drop_lowest = 'N');
--------------------------------------------------------
--  DDL for View V_TOPSTUDENTS
--------------------------------------------------------

  CREATE OR REPLACE FORCE VIEW "CISC181"."V_TOPSTUDENTS" ("STUDENT_ID", "FIRST_NAME", "LAST_NAME", "MaxGrade") AS 
  (

Select stu.student_id,
       stu.first_name,
       stu.last_name,
       max(gr.numeric_grade)
                                  
from student stu
inner join grade gr
on stu.Student_ID = gr.student_ID
Group By stu.student_ID,
         stu.first_name,
         stu.Last_name
);
