--  DDL for Package Body PKG_COURSE
--------------------------------------------------------

  CREATE OR REPLACE PACKAGE BODY "CISC181"."PKG_COURSE" 
AS
  /*
  This procedure will insert a course
  */
  PROCEDURE PRC_INSERT_COURSE(
      COURSE_NO_IN NUMBER ,
      DESCRIPTION_IN  IN VARCHAR2 ,
      COST_IN         IN NUMBER ,
      PREREQUISITE_IN IN NUMBER )
  IS
  BEGIN
    INSERT
    INTO COURSE
      (
        COURSE_NO,
        description,
        cost,
        prerequisite
      )
      VALUES
      (
        COURSE_NO_IN,
        DESCRIPTION_IN,
        COST_IN,
        PREREQUISITE_IN
      );
  EXCEPTION
  WHEN OTHERS THEN
    ROLLBACK;
  END PRC_INSERT_COURSE;
/*
This procedure will update a course
*/
  PROCEDURE PRC_UPDATE_COURSE
    (
      COURSE_NO_IN NUMBER ,
      DESCRIPTION_IN  IN VARCHAR2 ,
      COST_IN         IN NUMBER ,
      PREREQUISITE_IN IN NUMBER
    )
  IS
  BEGIN
    UPDATE COURSE
    SET description = DESCRIPTION_IN ,
      cost          = COST_IN ,
      prerequisite  = PREREQUISITE_IN
    WHERE Course_NO = COURSE_NO_IN;
  EXCEPTION
  WHEN OTHERS THEN
    ROLLBACK;
  END PRC_UPDATE_COURSE;
/*
This procedure will delete a course
*/
  PROCEDURE PRC_DELETE_COURSE(
      COURSE_NO_IN NUMBER)
  IS
  BEGIN
    DELETE FROM COURSE WHERE Course_NO = COURSE_NO_IN;
  EXCEPTION
  WHEN OTHERS THEN
    ROLLBACK;
  END PRC_DELETE_COURSE;
  
  
  
  
  PROCEDURE PRC_SELECT_COURSE(cursor_course OUT SYS_REFCURSOR)
  AS
  BEGIN
  OPEN cursor_course FOR
    SELECT COURSE_NO,
      DESCRIPTION,
      COST,
      PREREQUISITE,
      CREATED_BY,
      CREATED_DATE,
      MODIFIED_BY,
      MODIFIED_DATE
    FROM COURSE;
    

  END PRC_SELECT_COURSE;
END PKG_COURSE;

