  CREATE OR REPLACE PACKAGE BODY "CISC181"."TBLRULECARDS_TAPI" 
IS
  -- insert
  PROCEDURE ins(
      p_RULECARDID IN TBLRULECARDS.RULECARDID%type ,
      p_PICKORDER  IN TBLRULECARDS.PICKORDER%type ,
      p_RULEID     IN TBLRULECARDS.RULEID%type ,
      p_NBROFCARDS IN TBLRULECARDS.NBROFCARDS%type )
  IS
  BEGIN
    INSERT
    INTO TBLRULECARDS
      (
        RULECARDID ,
        PICKORDER ,
        RULEID ,
        NBROFCARDS
      )
      VALUES
      (
        p_RULECARDID ,
        p_PICKORDER ,
        p_RULEID ,
        p_NBROFCARDS
      );
  END;
-- update
  PROCEDURE upd
    (
      p_RULECARDID IN TBLRULECARDS.RULECARDID%type ,
      p_PICKORDER  IN TBLRULECARDS.PICKORDER%type ,
      p_RULEID     IN TBLRULECARDS.RULEID%type ,
      p_NBROFCARDS IN TBLRULECARDS.NBROFCARDS%type
    )
  IS
  BEGIN
    UPDATE TBLRULECARDS
    SET PICKORDER    = p_PICKORDER ,
      NBROFCARDS     = p_NBROFCARDS
    WHERE RULECARDID = p_RULECARDID
    AND RULEID       = p_RULEID;
  END;
-- del
  PROCEDURE del(
      p_RULECARDID IN TBLRULECARDS.RULECARDID%type ,
      p_RULEID     IN TBLRULECARDS.RULEID%type )
  IS
  BEGIN
    DELETE
    FROM TBLRULECARDS
    WHERE RULECARDID = p_RULECARDID
    AND RULEID       = p_RULEID;
  END;
END TBLRULECARDS_tapi;

